import React, { useEffect, useState } from 'react';
import { getPlaces } from '../API/placesaction';
import styled from 'styled-components';

const Card = styled.div`
    /* Add your card styles here */
`;

const Image = styled.img`
    /* Add your image styles here */
`;

const Title = styled.h5`
    /* Add your title styles here */
`;

const Description = styled.p`
    /* Add your description styles here */
`;

const Button = styled.a`
    /* Add your button styles here */
`;

const Places = () => {
    const [places, setPlaces] = useState([]);
    const [error, setError] = useState(null);

    useEffect(() => {
        getPlaces()
            .then(data => setPlaces(data))
            .catch(err => setError(err));
    }, []);

    if (error) {
        return <div>Error: {error.message}</div>;
    }

    return (
        <div>
            <div className="container">
                <div className="row">
                    {places.map(place => (
                        <div className="col-md-4" key={place.id}>
                            <Card className="card">
                                <Image src={place.image} alt="..." style={{ width: "100%" }} />
                                <div className="card-body">
                                    <Title className="card-title">{place.name}</Title>
                                    <Description className="card-text">{place.description}</Description>
                                    <Button href={`/book/${place.id}`} className="btn btn-primary">Go Book</Button>
                                </div>
                            </Card>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default Places;
